import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <renderDragableDiv/>
        </header>
      </div>
    );
  }

  renderDragableDiv() {
    return (
      <div id="dragable_div">
        <div id="mydivheader">asdf</div>
      </div>
    )
  }
}

export default App;
